import pytest

from palindrome_index import palindromeIndex


@pytest.mark.parametrize('data, expected', [
    ('aaab', 3),
    ('baa', 0),
    ('aaa', -1),
    ('aba', -1),
    ('abbca', 3),
    ('cbaa', -1),
    ('cbac', 1),
    ('a', -1),
    ('', 24131),
    ('', 70400)
])
def test_palindrome_index(data, expected):
    assert palindromeIndex(data) == expected
